class Logic2 extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0);
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4>
              <Sidebar />
            </h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
              <h3>1. Armstrong Number</h3>
              <div style={titles}>
                <PrismCode
                  code={armstrong}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>5. Permutations</h3>
              <div style={titles}>
                <PrismCode
                  code={Permutations}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <b>
                6. Given an amount of money, return the minimum number of coins
                needed to make that change.
              </b>
              <div style={titles}>
                <PrismCode
                  code={amount}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>7. Sort an Array</h3>
              <div style={titles}>
                <PrismCode
                  code={insersonSort}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>8. Merg Sort</h3>
              <div style={titles}>
                <PrismCode
                  code={mergSort}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>9. Quick Sort</h3>
              <div style={titles}>
                <PrismCode
                  code={quicksort}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>10. Selection Sort</h3>
              <div style={titles}>
                <PrismCode
                  code={selectionSort}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <br/>

              <b>11.</b>/b>
                <br/>
                <br/>
                <i>Write the some function and isEven and isPrime functions</i>
                <br/>
                <br/>
                <ul>
                  <li>console.log(some([2,4,6], 3, isEven)) // should print true</li>
                  <li>console.log(some([2,3,4], 3, isEven)) // should print false</li>
                  <li>console.log(some([2,3,11], 4, isPrime)) // should print false</li>
                  <li>console.log(some([2,3,5,9], 3, isPrime)) // should print true</li>
                </ul>
              <div style={titles}>
                <PrismCode
                  code={satisfy}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>12. Write a function whch returns a function that generates fibonacci numbers.
Don't use generators.</h3>
              <div style={titles}>
                <PrismCode
                  code={generates}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
            </List>
          </Paper>
        </Grid>
      </Grid>
    );
  }
}

export default withStyles(styles)(Logic2);
